/*****************************************************************************
 结构名    : PMIC_OTP0_CTRL0_UNION
 结构说明  : OTP0_CTRL0 寄存器结构定义。地址偏移量:0x19B，初值:0x00，宽度:8
 寄存器说明: OTP0控制0信号寄存器。
*****************************************************************************/
#ifndef __SOC_H_FOR_ASM__
typedef union
{
    unsigned char      value;
    struct
    {
        unsigned char  otp0_pwe_int   : 1;  /* bit[0-0]: OTP0写控制信号。
                                                         0：拉低otp_pwe，结束写操作；
                                                         1：拉高otp_pwe，发起写操作。
                                                         软件约束：需保证otp_por的高电平持续时间大于45us。两次高电平之间持续时间大于45us */
        unsigned char  otp0_pwe_pulse : 1;  /* bit[1-1]: OTP0写脉冲控制。
                                                         0：不发起脉冲；
                                                         1：发起一个310us的高电平脉冲。
                                                         软件约束：软件两次配置之间间隔需大于13个32K时钟周期 */
        unsigned char  otp0_por_int   : 1;  /* bit[2-2]: OTP0读控制信号。
                                                         0：拉低otp_por，结束读操作；
                                                         1：拉高otp_por，发起读操作。
                                                         软件约束：需保证otp_por的高电平持续时间大于45us。两次高电平之间持续时间大于45us */
        unsigned char  otp0_por_pulse : 1;  /* bit[3-3]: OTP0初始化控制信号。
                                                         0： 不发起脉冲；
                                                         1：发起一个30us的por高电平脉冲。
                                                         软件约束：软件两次配置之间间隔需大于6个32K时钟周期 */
        unsigned char  reserved       : 4;  /* bit[4-7]: 保留。 */
    } reg;
} PMIC_OTP0_CTRL0_UNION;
#endif
#define PMIC_OTP0_CTRL0_otp0_pwe_int_START    (0)
#define PMIC_OTP0_CTRL0_otp0_pwe_int_END      (0)
#define PMIC_OTP0_CTRL0_otp0_pwe_pulse_START  (1)
#define PMIC_OTP0_CTRL0_otp0_pwe_pulse_END    (1)
#define PMIC_OTP0_CTRL0_otp0_por_int_START    (2)
#define PMIC_OTP0_CTRL0_otp0_por_int_END      (2)
#define PMIC_OTP0_CTRL0_otp0_por_pulse_START  (3)
#define PMIC_OTP0_CTRL0_otp0_por_pulse_END    (3)


/*****************************************************************************
 结构名    : PMIC_OTP0_CTRL1_UNION
 结构说明  : OTP0_CTRL1 寄存器结构定义。地址偏移量:0x19C，初值:0x00，宽度:8
 寄存器说明: OTP0控制1信号寄存器。
*****************************************************************************/
#ifndef __SOC_H_FOR_ASM__
typedef union
{
    unsigned char      value;
    struct
    {
        unsigned char  otp0_pprog      : 1;  /* bit[0-0]: 编程模式使能信号。
                                                          0：关闭otp编程；
                                                          1：使能otp编程。 */
        unsigned char  otp0_inctrl_sel : 1;  /* bit[1-1]: 0：芯片内部自动读；（默认）
                                                          1：寄存器控制。 
                                                          开机后此寄存器必须配置为1，否则无法通过寄存器发起otp读操作 */
        unsigned char  reserved        : 6;  /* bit[2-7]: 保留。 */
    } reg;
} PMIC_OTP0_CTRL1_UNION;
#endif
#define PMIC_OTP0_CTRL1_otp0_pprog_START       (0)
#define PMIC_OTP0_CTRL1_otp0_pprog_END         (0)
#define PMIC_OTP0_CTRL1_otp0_inctrl_sel_START  (1)
#define PMIC_OTP0_CTRL1_otp0_inctrl_sel_END    (1)


/*****************************************************************************
 结构名    : PMIC_OTP0_CTRL2_UNION
 结构说明  : OTP0_CTRL2 寄存器结构定义。地址偏移量:0x19D，初值:0x00，宽度:8
 寄存器说明: OTP0控制2信号寄存器。
*****************************************************************************/
#ifndef __SOC_H_FOR_ASM__
typedef union
{
    unsigned char      value;
    struct
    {
        unsigned char  otp0_pa_cfg : 6;  /* bit[0-5]: OTP的地址信号。
                                                      读模式：（每次读出16bit，地址加2）
                                                      000000：选择otp器件地址为6'b000000的进行读操作；
                                                      000010：选择otp器件地址为6'b000010的进行读操作；
                                                      000100：选择otp器件地址为6'b0000100的进行读操作；
                                                      ……
                                                      111110：选择otp器件地址为6'b111110的进行读操作。
                                                      编程模式：（每次写8bit）
                                                      000000：选择otp器件地址为6'b000000的进行写操作；
                                                      000001：选择otp器件地址为6'b000001的进行写操作；
                                                      000010：选择otp器件地址为6'b0000010的进行写操作；
                                                      ……
                                                      111111：选择otp器件地址为6'b111111的进行写操作。
                                                      软件约束：
                                                      1)采用otp0_por_pulse方式读取数据时，向otp0_por_pulse写1时刻需保证otp0_pa_cfg地址提前4ns准备好，自otp0_por_pulse写1时刻起，需保证otp0_pa_cfg地址持续时间大于等于192us(6个32k clk);
                                                      2)采用otp0_por_int方式读取数据时，otp0_por_int写1时刻需保证otp0_pa_cfg地址提前4ns准备好，向otp0_por_int写0时刻起，需保证otp0_pa_cfg地址持续时间大于等于62us(2个32k clk)； */
        unsigned char  otp0_ptm    : 2;  /* bit[6-7]: 测试模式使能信号。
                                                      00：用户模式；
                                                      01：未定义；
                                                      10：margin_1读模式；
                                                      11：margin_2读模式。 */
    } reg;
} PMIC_OTP0_CTRL2_UNION;
#endif
#define PMIC_OTP0_CTRL2_otp0_pa_cfg_START  (0)
#define PMIC_OTP0_CTRL2_otp0_pa_cfg_END    (5)
#define PMIC_OTP0_CTRL2_otp0_ptm_START     (6)
#define PMIC_OTP0_CTRL2_otp0_ptm_END       (7)


