#ifndef __SOC_H_FOR_ASM__
typedef union
{
    unsigned char      value;
    struct
    {
        unsigned char  xoadc_data_rate_sel : 3;  /* bit[0-2]: 滤波器降采样率选择
                                                              000：64 (75KSPS@4.8M)
                                                              001：128 (37.5KSPS@4.8M)
                                                              010：256 (18.75KSPS@4.8M)
                                                              011：512 (9.375KSPS@4.8M) 默认
                                                              100：1024 (4687.5SPS@4.8M)
                                                              101：2048 (2343.75SPS@4.8M)
                                                              其他：512 (9.375KSPS@4.8M)
                                                              该寄存器的默认值可以通过OTP+预修调寄存的方式选择：
                                                              000：默认值为3'b011
                                                              001：默认值为3'b000
                                                              010：默认值为3'b001
                                                              011：默认值为3'b010
                                                              100：默认值为3'b100
                                                              101：默认值为3'b101
                                                              其他：默认值为3'b011 */
        unsigned char  xoadc_sdm_clk_sel   : 1;  /* bit[3]  : XOADC 采样时钟频率选择
                                                              1：2.4MHz 
                                                              0：4.8MHz
                                                              该寄存器的默认值可以通过OTP+预修调寄存的方式选择：
                                                              0：默认值是1'b0
                                                              1：默认值是1'b1 */
        unsigned char  xo_chop_fre_sel     : 2;  /* bit[4-5]: （≤9.375KSPS@4.8M ）
                                                              00：37.5KHz
                                                              01：18.75Khz
                                                              10：75Khz
                                                              11：150Khz
                                                              （18.75KSPS@4.8M ）
                                                              00：37.5KHz
                                                              01：37.5Khz
                                                              10：75Khz
                                                              11：150Khz
                                                              （37.5KSPS@4.8M ）
                                                              00：150KHz
                                                              01：75Khz
                                                              10：150Khz
                                                              11：150Khz
                                                              （75KSPS@4.8M ）
                                                              均为150Khz；
                                                              当采样频率减半，以上对应关系都同比例减半 */
        unsigned char  xo_chop_en          : 1;  /* bit[6]  : XOADC输入buffer的chopper使能：
                                                              0：disable；
                                                              1：enable 。 */
        unsigned char  reserved            : 1;  /* bit[7]  : 保留。 */
    } reg;
} PMIC_XOADC_CTRL_UNION;
#endif
